import React from "react";
import human from "../../../Image/human.jpg";
import human2 from "../../../Image/human2.jpg";
import "./NavTop.css";

const NavTop = () => {
  return (
    <div className="navtop">
      <div className="row in-profile">
        <div className="col ">
          <img src={human} alt="" width="80" className="rounded-circle" />
          <i className="fa fa-bars icon float-right"></i>
        </div>
      </div>
      <div className="list-profile">
        <div className="row list">
          <div className="col">
              <img src={human2} alt=""  width="80" className="rounded-circle float-left"/>
              <div className="desc-list">
              <h5>Abdillah</h5>
              <p>Alhamdulillah sehat akhiii</p>
              </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default NavTop;
